import './App.css'
function Links() {
    return (
        <div className="links">
            <h2>Links</h2>
            <ul>
                <li><a href="#home">Home</a></li>
                <li><a href="#menu">Menu</a></li>
                <li><a href="#contact">Contact</a></li>
            </ul>
        </div>
    );
}

export default Links;
